func getFolderNames(names []string) []string {
	var ret = map[string]int{}
	var ans []string
	for _, k := range names {
		base := k
		i := ret[k]
		if i == 0 {
			ret[k] = 1
			ans = append(ans, k)
			continue
		}
		for ret[k] != 0 {
			k = fmt.Sprintf("%s(%d)", base, i)
			i++
		}
		ans = append(ans, k)
		ret[k] = 1
		ret[base] = i
	}
	return ans
}

